import React, { Component } from 'react';
import {
    Line,
    SteppedLine,
    PolyLine,
    Circle,
    Rectangle
} from 'draw-shape-reactjs';

class HexagonCluster extends Component {

  constructor(props) {
    super(props);
    this.state = {
      hexagons: []
    }
  }

  render () {
    return (
      <div>
        Hi there
        <Line
          position='fixed'
          from={[0, 610]}
          to={[600, 850]}
          color='#1DBFE7'
        />
      </div>
    )
  }
}

export default HexagonCluster;
